function isValidHost(urlString) {
  const url = new URL(urlString);
  return url.hostname === 'account.brave.com';
}

function gotoBraveAccount() {
  const { redirect } = Host.getFunctions();
  const mem = Memory.fromString('https://account.brave.com');
  redirect(mem.offset);
}

function start() {
  if (!isValidHost(Config.get('tabUrl'))) {
    gotoBraveAccount();
    Host.outputString(JSON.stringify(false));
    return;
  }
  Host.outputString(JSON.stringify(true));
}

function two() {
  const cookies = JSON.parse(Config.get('cookies'))['subscriptions.bsg.brave.com'];
  const headers = JSON.parse(Config.get('headers'))['subscriptions.bsg.brave.com'];
  if (
    !cookies.token
    || !headers['x-csrf-token']
  ) {
    Host.outputString(JSON.stringify(false));
    return;
  }

  const cookiesString = Object.entries(cookies)
    .map(([key, value]) => `${key}=${value}`)
    .join(";");

  Host.outputString(
    JSON.stringify({
      url: 'https://subscriptions.bsg.brave.com/v1/subscribers',
      method: 'GET',
      headers: {
        Host: 'subscriptions.bsg.brave.com',
        Cookie: `${cookiesString}`,
        'X-Csrf-Token': headers['X-Csrf-Token'],
        Connection: 'close'
      }
    }),
  );
}

function three() {
  const params = JSON.parse(Host.inputString());
  const { notarize } = Host.getFunctions();

  if (!params) {
    Host.outputString(JSON.stringify(false));
  } else {
    const mem = Memory.fromString(JSON.stringify(params));
    const idOffset = notarize(mem.offset);
    const id = Memory.find(idOffset).readString();
    Host.outputString(JSON.stringify(id));
  }
}

function config() {
  Host.outputString(
    JSON.stringify({
      title: 'Brave Profile',
      description: 'Notarize ownership of a Brave account',
      icon: 'data:image/png;base64,',
      steps: [
        {
          title: 'Visit Brave website',
          cta: 'Go to account.brave.com',
          action: 'start',
        },
        {
          title: 'Collect credentials',
          description: "Login to your account if you haven't already",
          cta: 'Check cookies',
          action: 'two',
        },
        {
          title: 'Notarize Brave profile',
          cta: 'Notarize',
          action: 'three',
          prover: true,
        },
      ],
      hostFunctions: ['redirect', 'notarize'],
      cookies: ['subscriptions.bsg.brave.com'],
      headers: ['subscriptions.bsg.brave.com'],
      requests: [
        {
          url: 'https://subscriptions.bsg.brave.com/v1/subscribers',
          method: 'GET',
        },
      ],
    }),
  );
}

module.exports = { start, config, two, three };
